package midel;

/**
 * 给你一个二进制串 s  （一个只包含 0 和 1 的字符串），我们可以将 s 分割成 3 个 非空 字符串 s1, s2, s3 （s1 + s2 + s3 = s）。
 *
 * 请你返回分割 s 的方案数，满足 s1，s2 和 s3 中字符 '1' 的数目相同。
 *
 * 由于答案可能很大，请将它对 10^9 + 7 取余后返回。
 *
 *  
 *
 * 示例 1：
 *
 * 输入：s = "10101"
 * 输出：4
 * 解释：总共有 4 种方法将 s 分割成含有 '1' 数目相同的三个子字符串。
 * "1|010|1"
 * "1|01|01"
 * "10|10|1"
 * "10|1|01"
 * 示例 2：
 *
 * 输入：s = "1001"
 * 输出：0
 * 示例 3：
 *
 * 输入：s = "0000"
 * 输出：3
 * 解释：总共有 3 种分割 s 的方法。
 * "0|0|00"
 * "0|00|0"
 * "00|0|0"
 * 示例 4：
 *
 * 输入：s = "100100010100110"
 * 输出：12
 *  
 *
 * 提示：
 *
 * s[i] == '0' 或者 s[i] == '1'
 * 3 <= s.length <= 10^5
 *
 * 来源：力扣（LeetCode）
 * 链接：https://leetcode-cn.com/problems/number-of-ways-to-split-a-string
 * 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
 */
public class NumWays {
    public static void main(String[] args) {
        String s = "";
        NumWays n = new NumWays();
        int result = n.numWays(s);
        System.out.println(result);
    }
    //找三等分点
    public int numWays(String s) {
        int n = s.length();
        // System.out.println(n);
        int one = 0;  // "1" 的个数
        for(int i = 0;i <= n - 1;i++){
            if(s.substring(i,i + 1).equals("1")){
                one++;
            }
        }
        if(one%3 != 0 && one != 0){ //"1" 的个数不是 0 也不是 3的倍数个
            return 0;
        }
        if(one == 0){   //没有 "1"
            long x = n - 1;
            long y = n - 2;
            long z = (x*y/2)%1000000007;
            return (int)z;    //C(2,n - 1)     排列组合
        }

        int index = 0;
        int p = -1;
        int q = -1;
        int r = -1;
        int k = -1;
        int sum = one/3;
        for(int i = 0;i <= n - 1;i++){
            if(s.substring(i,i + 1).equals("1")){
                index++;
                if(p == -1 && index == sum){
                    p = i;
                }
                if(q == -1 && index == sum + 1){
                    q = i;
                }
                if(r == -1 && index == 2 * sum){
                    r = i;
                }
                if(k == -1 && index == 2 * sum + 1){
                    k = i;
                }
            }
        }
        long a = q - p;
        long b = k - r;
        long temp = a*b;
        // System.out.println(temp);
        long result = temp%1000000007;

        return (int)result;
    }
}
